const key =
  'pk.eyJ1IjoibWljaGFsc3RhY2huaWsiLCJhIjoiY2thdHVnOXRwMGVlaDJxb2M5bmVnbXVwYSJ9.PMitc9_GavR10drtsXbcDg';

function HomePage({ json }) {
  console.log('the json I got', json);
  return (
    <div>
      <h1>Welcome to Farm Finder</h1>
    </div>
  );
}

HomePage.getInitialProps = async (ctx) => {
  const res = await fetch(
    `https://api.mapbox.com/geocoding/v5/mapbox.places/Los%20Angeles.json?access_token=${key}`
  );

  const json = await res.json();
  console.log('done fetching');
  return {
    data: json,
  };
};

export default HomePage;
